        }
    }

    handleRe = () => {
        this.setState({ likes: this.state.likes + 1 })
    }
    getDate = () => {
        return <Signup handleRe={this.handleRe} />
    }

    render() {
        return (
            <div>
                {/* {this.getDate()} */}
                <div onClick={this.getDate()}>
                    likes{this.state.likes}
                </div>
                {/* <Signup handleRe={this.handleRe} /> */}
            </div>
        )
    }
}

